const BotonFormulario = (props) => {
    if(props.func == null){
        let button = <button type="submit">{props.value}</button>
    }
    else{
        let button = <button type="submit" onClick={props.func}>{props.value}</button>
    }
    return(
        <div>{button}</div>
    );
}

export default BotonFormulario;
